import React, { Component } from 'react'
import ReactPlayer from 'react-player'

export default class MakeVideoPlayer extends Component {
    constructor(props) {
        super(props);
    }


    render () {
        return <ReactPlayer url={this.props.source} light controls width={500} height={250} />
    }
}
